import React, { useState } from 'react';
import Grid from '@material-ui/core/Grid';



export default function MultipleJobs(){
    return (
        <Grid 
        container 
        justify="center" 
        alignItems="center" 
        className="mainGrid"
        >

            <Grid item>
                <h1 className="heading">What's your Marital Status?</h1>
            </Grid>

        </Grid>
    )
}
